import React from "react";
import "./App.css";
import Sidebar from "./Components/Sidebar";
import Main from "./Components/Main";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App wrapper">
        <Sidebar></Sidebar>
        <Main></Main>
      </div>
    </Router>
  );
}

export default App;
